import React from "react";
import logo from "./images/logo-2.png"
import user from "./im"

class Header extends React.Component {
  render() {
    return (
      <header className="header">
        <div className="header__leftside">
          <img className="header__logo" src="images/logo-2.png" alt="logo" />
          <input
            className="header__search"
            placeholder="Search Libro"
            type="text"
          />
        </div>
        <div className="header__rightside">
          <div className="header__nav">
            <button className="header__button">Головна</button>
            <button className="header__button">Жанр</button>
            <button className="header__button">Автор</button>
            <button className="header__button">Про нас</button>
            <img className="header__user" src="./images/user.png" alt="user" />
          </div>
        </div>
      </header>
    );
  }
}

export default Header;
